import React, { useState, useEffect, memo } from 'react';
import Link from '../Link';
import { FaShoppingBasket, FaRegUserCircle } from 'react-icons/fa';
import { ReactComponent as SendSvg } from '../../static/svg/send.svg';
import '../../scss/components/indexHeader.scss';
const IndexHeader = () => {
  return (
    <div className="container mt-1 index_header">
      <div className="row d-flex d-lg-none">
        <div className="col-4">
          <Link href="/" passHref>
            <a className="nav_Icons active">
              <FaShoppingBasket />
              <div className="badge badge-success">10</div>
            </a>
          </Link>
        </div>
        <div className="col-4 d-flex justify-content-center">
          <Link href="/" passHref>
            <a className="navbar-brand">
              <img src="../../static/img/splash.png" width="80" height="80" className="d-inline-block align-top" alt="" />
            </a>
          </Link>
        </div>
        <div className="col-4 d-flex justify-content-end">
          <Link href="/" passHref>
            <a className="nav_Icons">
              <SendSvg className="svg_Icons" />
            </a>
          </Link>
        </div>
      </div>
    </div>
  );
};
export default memo(IndexHeader);
